tables.table_schema:
CREATE TABLE BiometricData (
    user_id INT,
    fingerprint_data BYTEA,
    face_data BYTEA,
    created_at TIMESTAMP
);

CREATE TABLE biometric_data (
  id SERIAL PRIMARY KEY,
  fingerprint_data BYTEA NOT NULL,
  user_id INT NOT NULL,
  timestamp TIMESTAMP NOT NULL
);

CREATE TABLE users (
  user_id SERIAL PRIMARY KEY,
  username VARCHAR(50) NOT NULL,
  password VARCHAR(50) NOT NULL
);

CREATE TABLE access_logs (
  log_id SERIAL PRIMARY KEY,
  user_id INT NOT NULL,
  access_timestamp TIMESTAMP NOT NULL,
  access_type VARCHAR(20) NOT NULL
);

CREATE TABLE biometric_users (
    user_id UUID PRIMARY KEY,
    username TEXT NOT NULL,
    fingerprint_data BYTES NOT NULL
);

CREATE TABLE access_logs (
    log_id UUID PRIMARY KEY,
    user_id UUID REFERENCES biometric_users(user_id),
    log_time TIMESTAMP NOT NULL,
    action TEXT NOT NULL
);

CREATE TABLE access_levels (
    level_id UUID PRIMARY KEY,
    level_name TEXT NOT NULL,
    access_type ENUM('admin', 'user', 'guest')
);

CREATE TABLE access_rights (
    user_id UUID REFERENCES biometric_users(user_id),
    level_id UUID REFERENCES access_levels(level_id),
    PRIMARY KEY (user_id, level_id)
);

CREATE TABLE biometric_users (
    user_id INT PRIMARY KEY,
    first_name VARCHAR(50),
    last_name VARCHAR(50),
    fingerprint_data BYTEA
);

CREATE TABLE fingerprint_scans (
    scan_id INT PRIMARY KEY,
    user_id INT REFERENCES biometric_users(user_id),
    scan_data BYTEA,
    scan_timestamp TIMESTAMP
);

CREATE TABLE facial_scans (
    scan_id INT PRIMARY KEY,
    user_id INT REFERENCES biometric_users(user_id),
    image_data BYTEA,
    scan_timestamp TIMESTAMP
);

CREATE TABLE voice_recognition (
    recording_id INT PRIMARY KEY,
    user_id INT REFERENCES biometric_users(user_id),
    audio_data BYTEA,
    recording_timestamp TIMESTAMP
);

CREATE TABLE access_logs (
    log_id INT PRIMARY KEY,
    user_id INT REFERENCES biometric_users(user_id),
    access_type VARCHAR(20),
    access_timestamp TIMESTAMP
);
